        // .then(res => {
        //   (res.data).map((setting)=>{
        //     //console.log(setting.Minor)
        //     axios.get('/@/test/selectByMinorList',{params:{Minor:setting.Minor}})
        //     .then(res=>{
        //       row = res.data
        //       table = ({...setting, rows: row});
        //       //console.log(table)
        //       //setTables(tables.concat({...setting, rows: row}))
        //       //onsole.log('보자보자',tables)
        //       //treeProvider.current.setObjectRows(tables,'Minor',false);
        //       console.log(table)
        //     }) //then 끝
        //     //console.log(tables)
        //   })// map 끝
        //  // console.log(tables)###
         
        // //  treeProvider.current.setObjectRows(tables,{ tables:"rows" },false);
        // }); //then 끝
        // // console.log(table)
     
      


    return (
        <>  
      <Box style={Styles.s1} display="flex" flexDirection="column" alignItems="center">
        <Box style={{ width: $Dim * 500, height: $Dim * 200, marginTop: $Dim * 20 }} display="flex" flexDirection="column" alignItems="center" justifyContent="center">
        <button></button>
        <div id="realgrid" style={Styles.s2}></div>
        <div style={{display:'flex'}}>
        <div style={{justifyContent:'flex-start'}}>
        <Button variant="contained">신규항목</Button>
        <Button variant="contained">코드추가</Button>
        </div>
        <div>
        <Button variant="contained">저장</Button>
        </div>
        </div>
        </Box>
      </Box>
        </> 
    );
};

const fStyles = ($Dim) => {
    return {
      s1: { width: $Dim * 1000, height: $Dim * 550, background: '#fff' },
      s2: { width: $Dim * 500, height: $Dim * 200, marginTop: $Dim * 30},
    };
  };

export default withRouter(Start);
